import React from "react";

const styles = {
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  justifyContent: "center",
  margin: "30px",
  border: "1px solid black",
};

function pokemonDetailed({ name, image }) {
  return (
    <div style={styles}>
      <h2>{name}</h2>
      <img style={{ width: "190px", height: "265px" }} src={image} />
    </div>
  );
}

export default pokemonDetailed;
